const MapItem = ({ map }) => {
  console.log(map);
  return (
    <div className="MapItem">
      <div className="ImageDiv">
        <img src={"/mapimages/" + map.image} alt={map.name} />
      </div>
      <div>
        <h1>{map.name}</h1>
        <p>{map.description}</p>
        <button onClick="">Play</button>
      </div>
    </div>
  );
};

export default MapItem;
